INSERT INTO `info` (`id`, `quest_id`, `inf_name`, `text`) VALUES
(40, 41, 'id1', 'это транспортное средство дорожно - патрульной службы (автомобиль, мотоцикл, автобус), имеющий такие отличительные черты, как окраску, световой и звуковой сигналы, а также бортовой номер'),
(41, 41, 'id2', 'это транспортное средство, принадлежащее на праве собственности сотруднику дорожно - патрульной полиции, не предназначенная для осуществления патрулирования. '),
(42, 42, 'id1', 'представление сотудника заключается в следующем:<br>1)«отдать честь», то есть осуществить приветствие;<br>2)Назвать должность;<br>3)Специальное звание;<br>4)Фамилия;<br>5)Подразделение, в котором осуществляет службу;<br>6)Причина остановки.<br>В случае остановки ТС, сотрдуник обязан<br>*незамедлительно подойти к ТС,<br>*представится и по Вашему требованию предоставить служебное удостоверение,<br>*разъяснить причину остановки, а также* если Ваше правонарушение зафиксированно на контрольо - измерительное средсвто (прибор), предоставить для ознакомления.<br>'),
(43, 42, 'id2', 'преднамеренное прекращение движения транспортного средства на время до пяти минут либо на большее время, если это необходимо для посадки или высадки пассажиров, загрузки или разгрузки транспортного средства.<br><a href=\"http://online.zakon.kz/Document/?doc_id=31536713\">Закон РК «О дорожном движении» от 17.04.2014 с изменениями и дополнениями по состоянию на 03.07.2017 </a>'),
(44, 41, 'img', 'imglink[https://bot.edufix.kz/img/0.jpg]\r\ntext[Описание жетона, добавлено из редактора инструкций проекта ЮрСоветник.]'),
(45, 41, 'img', 'imglink[https://bot.edufix.kz/img/1.jpg]\r\ntext[Например, другое описание, другая картинка.]');
