(462981252, 2924, 424823219, '2018-04-02 17:30:52', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'В категории \'Ситуации на дороге\' есть следующие инструкции. \nВыберите номер под данным сообщением для ее просмотра.\n--------------------------------------------------------\n1 - Остановка транспортного средства инспектором\n2 - Проезд на красный', '[{\"offset\":13,\"length\":18,\"type\":\"bold\"},{\"offset\":173,\"length\":4,\"type\":\"bold\"},{\"offset\":222,\"length\":4,\"type\":\"bold\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
