(43, 9, 'Вы имеете право потребовать предоставления служебного удостоверения ознакомления фамилии и должности сотрудника, которым Вы были остановлены. Ваше требование выполнили?', 3),
(44, 9, 'Зафиксируйте служебный жетон сотрудника на фото-, видеосъемку, в случае остановки на служебном а/м – бортовой и государственный номер а/м.', 4),
(45, 9, 'Имеете право составить жалобу на данного сотрудника в Управление административной полиции ДВД г.Астаны, расположенных по адресу: Ул.Жетиген 16, Ул.Жетиген 27/2, Пр.Н.Тлиендиевой 1', 5),
(46, 9, 'Ваша инструкция окончена.', 6),
(47, 10, 'Инструкция в разработке.', 1);
